import React from 'react';
import ReactAnimatedWeather from 'react-animated-weather';

const typeOfIcon = icon => {
  switch (icon) {
    case 'CLEAR-DAY':
      return 'CLEAR_DAY';
    case 'CLEAR-NIGHT':
      return 'CLEAR_NIGHT';
    case 'PARTLY-CLOUDY-DAY':
      return 'PARTLY_CLOUDY_DAY';
    case 'PARTLY-CLOUDY-NIGHTY':
      return 'PARTLY_CLOUDY_NIGHTY';
    case 'CLOUDY':
      return 'CLOUDY';
    case 'RAIN':
      return 'RAIN';
    case 'SLEET':
      return 'SLEET';
    case 'SNOW':
      return 'SNOW';
    case 'WIND':
      return 'WIND';
    case 'FOG':
      return 'FOG';

    default:
      break;
  }
};

const WeatherIcon = props => {
  return <ReactAnimatedWeather icon={props.icon.toUpperCase()} />;
};

export default WeatherIcon;

// ["CLEAR_DAY","CLEAR_NIGHT","PARTLY_CLOUDY_DAY","PARTLY_CLOUDY_NIGHT","CLOUDY","RAIN","SLEET","SNOW","WIND","FOG"].
